window.bookSummaryJSON = "<p><b>War has come to Dimvein.</b></p> <p>The Empire’s ancient foes have come to destroy, bringing with them threats new and old. The Blood Clan pirates and the savage Hudar Horde cavalry are joined by the magic of the Vandil, long believed lost to the ages.</p> <p>Kullen and Natisse must fight to preserve the threads that hold Dimvein together. Only together can they and their allies both high and low keep the enemy from burning everything they’ve built to the ground. It’s a race to the end, blades slashing and fire raging.</p> <p><b><i>Silver Spines</i></b><b> is the third installment in Dragonblood Assassin from number one Audible and </b><b><i>Washington Post</i></b><b> best seller Jaime Castle and epic fantasy legend Andy Peloquin, perfect for fans of the Forgotten Realms, Joe Abercrombie, David Dalglish, and Kel Kade.</b></p>"; 
